19:"2391226555416029851";}i:53;a:1:{s:10:"short_code";s:11:"CEvV-IFDaqb";}i:54;a:1:{s:12:"created_time";i:1599276440;}i:55;a:1:{s:7:"caption";s:2061:"Mi vida no es todo color de rosas; no siempre estamos así de felices como en esta foto. 

Soy mamá, soy mujer y no soy un robot. Me canso, me estreso y a veces pierdo el control. De vez en cuando lloro de lo agotada que estoy. 

Yo paso los días sola en la casa con el bebé. Y es el trabajo más fuerte que existe. Tengo que cocinar, ordenar, comer, atender al bebé, dormirlo 3 veces en el día (lo más difícil), bañarlo, jugar con el, lavar ropa, y al final del día, tratar de ser esposa (porque ya lo tengo medio abandonado al pobre esposo 🤣)

Pero nunca permito que estas cosas opaquen lo más bello que existe, que es ver a mi bebé sonreír. Yo podré estar “molesta con el”, sí, a veces creo molestarme con el porque me consume y no me deja trabajar o hacer mis cosas en el momento que quiero; pero después el me mira y me sonríe y mi corazón se infla casi a explotar de tanto amor (Lo pienso y se me eriza la piel).

Diez minutos antes de esta foto el bebé tenía sueño y cuando fui a dormirlo; duré 20 minutos tratando que tomara la siesta, ya maquillada y todo para tomarme las fotitos. Al final el nunca se durmió y yo me estrese mucho porque no quería perder tiempo. 

Y al salir de su cuarto el salió como si hubiese dormido la noche entera, feliz y sonriendo. Y me cambio por completo el animo. Me revivió y mi día volvió a verse bonito. 

Nosotras las madres tenemos derecho a equivocarnos porque somos humanas y no nacemos sabiéndolo todo, no nacemos sabiendo cómo afrontar situaciones difíciles con nuestros hijos, no sabemos cómo mantener la calma a veces cuando estamos a punto de caernos del cansancio y sin opción para descansar. 

Pero por eso nosotras somos las madres, por eso las mujeres son las madres, porque somos capaces de aguantarlo todo, porque somos más fuertes que cualquier otro ser, tanto físico como sentimentalmente. 

Amo ser mujer y me admiro por todo lo que cada día soy capaz de hacer. 

