While I am struggling with those feelings I am also struggling with contradicting feelings .... patience with my 4 year old. 

He has been having a lot of big emotions; I think he is feeding off of my stress. I am constantly saying control your body, be gentle with your sister, please don’t knock the chairs down, no hitting.... etc. I feel like I am a broken record. I feel guilty needing a minute to breath to regroup and I feel guilty I am getting that next week.

Being a Mom is hard, it’s emotional, exhausting, rewarding, a blessing and it is beautiful all at the same time. 

Next week is going to be hard emotionally for all of us. There is going to be an adjustment period but I am excited to see my kiddos thrive at school and to make new friends. 

Life doesn’t always look like the little squares on the gram; life is messy and chaotic. I love being a Mom to these guys, I love being their advocate and their biggest cheerleader. Now I am going to go cry and continue to have contradicting emotions. 

