t I looked Amazing! 😍 From the front my stomach looked flat &from the back my 🍑 was fat! 😏😂 What more could I ask for?? Lmao";}i:160;a:1:{s:14:"comments_count";i:1;}i:161;a:1:{s:11:"likes_count";i:5;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvS_syhBvu";}i:163;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118766126_119932279828475_2944854869999043814_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=YUW6MFVl4D4AX9LC5S6&oh=ff2ec801a119f8538eb4ff8802417e25&oe=5F7B9C8E";}i:164;a:1:{s:4:"type";s:5:"image";}i:165;a:1:{s:8:"owner_id";i:6465869720;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"";}i:169;a:1:{s:2:"id";s:19:"2391213339465274613";}i:170;a:1:{s:10:"short_code";s:11:"CEvS9zxANT1";}i:171;a:1:{s:12:"created_time";i:1599274865;}i:172;a:1:{s:7:"caption";s:918:"🔆Water Balloons🔆

